window.bookSummaryJSON = "<p>Friendship. Love. Two things Ainsley had found for the first time in her life, only to lose them in the blink of an eye. Betrayed and heartbroken, she must work to overcome the pain of her past. Now trapped in a new kingdom ruled by a king who wants far more from her than he’s leading on, she will have to find the strength to persevere. But as Ainsley becomes more sure of herself and her magical abilities, a force threatens to take away all she’s gained.</p> <p>With her homeland of Disparya on the brink of war, she must decide what role she wants to play and what she is willing to sacrifice. She must decide whom to trust. However, things aren’t always as they seem…</p>"; 
